import HeaderTitleIcon from "./HeaderTitleIcon";
import LanguageDropDownButton from "./LanguageDropDownButton";
import Searchicon from "./Searchicon";
import React, { useState, useEffect } from "react";
export default function Header() {
  const [mounted, setMounted] = useState(false);
  if (!mounted) {
    // Code for componentWillMount here
    // This code is called only one time before intial render

    navigator.geolocation.getCurrentPosition(function (position) {
      console.log("Latitude is :", position.coords.latitude);
      console.log("Longitude is :", position.coords.longitude);
    });
  }

  useEffect(() => {
    setMounted(true);
  }, []);
  return (
    <div className="flex mt-5 ml-5">
      <HeaderTitleIcon className="mx-5"></HeaderTitleIcon>

      <Searchicon></Searchicon>
      <input
        type="text"
        placeholder="Search.."
        className="border-black  pl-5 border-2 ml-4 rounded-sm"
      ></input>

      <div className="bg-yellow-700  ml-5  w-1/2 justify-center content-center flex">
        <input
          type="text"
          placeholder="Find cars, Mobile phones and more"
          className="pl-4 border-black border-2 rounded-sm w-full"
        ></input>
      </div>
      <button className="bg-white w-10 h-10 content-center justify-center">
        <Searchicon></Searchicon>
      </button>
      <div className="flex pr-0 ml-5 mr-10 bg-gray-600">
        <LanguageDropDownButton></LanguageDropDownButton>
        <button className="mx-5">Login</button>
        <button className="mx-5">Sell</button>
      </div>
    </div>
  );
}
